import React from "react";

function WelcomePage() {
  return (
    <div>
      {/* Header Section */}
      <header style={styles.header}>
        <h1>Welcome to the Experiment</h1>
      </header>

      <main style={styles.main}>
        <p>
          Thank you for participating! In this experiment, you will identify
          identifiers written in <b>camelCase</b> or <b>kebab-case</b>. Follow
          the instructions carefully and try your best!
        </p>
        <button
          style={styles.button}
          onClick={() => (window.location.href = "/form")}
        >
          Start Experiment
        </button>
      </main>

      <footer style={styles.footer}>
        <p>Experimentation & Evaluation - 2024</p>
        <p>&copy; Noah Salvi, Alessandro Della Flora, Stipe Peran</p>
      </footer>
    </div>
  );
}

// Inline styles for simplicity
const styles = {
  header: {
    backgroundColor: "#282c34",
    color: "white",
    padding: "20px",
    textAlign: "center",
  },
  main: {
    padding: "20px",
    textAlign: "center",
  },
  button: {
    padding: "10px 20px",
    fontSize: "16px",
    cursor: "pointer",
    backgroundColor: "#61dafb",
    border: "none",
    borderRadius: "5px",
  },
  footer: {
    backgroundColor: "#f1f1f1",
    color: "#333",
    padding: "10px",
    position: "fixed",
    bottom: "0",
    width: "100%",
    textAlign: "center",
  },
};

export default WelcomePage;
